  {id: 1, title: 'Learn React'},
  {id: 2, title: 'learn Nodejs'},
  {id: 3, title: 'learn Nextjs'}
];

function App() {
  const [tasks, setTask] = useState(list);
  const [isLoading, toggleLoading] = useState(false);
  return (
    <div className="App">
      <div className="row">

      </div>
      <h2>Tasky</h2>
      <TaskList tasks = {tasks} />
    </div>
  );
}

export default App;
